import React from 'react'
import AllProduct from './AllProduct';
import Product from './Product';
import filter from './search';


function Filtered({ products, searchKey }) {

  return (
      <div className="Filtered">
      {products && <AllProduct products={filter(products, searchKey)} />}
      {products && 
        <div className="searchResult">
          {filter(products, searchKey).map((prod) => {
            return (
              <div className="products" key ={prod.id}>
                        <Product
                            id={prod.id}
                            title={prod.title}
                            price={prod.price}
                            image={prod.thumbnail}
                            rating={prod.rating}
                    />
                <button onClick={() => { handleAddToCart(prod, user, dispatch, navigate) }}>Add to cart</button>
              </div>
        )
          })}
        </div>
      }
    </div>
  )
}

export default Filtered
